function enable_dark_mode(){const e=new Request("/settings/web/dark_mode/set",{method:"GET",headers:{"Content-Type":"application/json"}});fetch(e).then((e=>{if(200!==e.status)throw new Error("Something went wrong on API server!")}))}function disable_dark_mode(){const e=new Request("/settings/web/dark_mode/unset",{method:"GET",headers:{"Content-Type":"application/json"}});fetch(e).then((e=>{if(200!==e.status)throw new Error("Something went wrong on API server!")}))}function set_nbr_items_per_page(e){let t="/settings/web/nbr_items_per_page/set?nbr_items_per_page=".concat("",e);const n=new Request(t,{method:"GET",headers:{"Content-Type":"application/json"}});fetch(n).then((e=>{if(200!==e.status)throw new Error("Something went wrong on API server!")}))}